import React from "react";
import './main.css';
import Navbar from "./components/navbar";

export default function Main(){
    return (
        <div className="bg">
            <Navbar />
            <div className="mvPlayer">
            <video controls="true">
                <source src="www.youtube.com/watch?v=IEDEtZ4UVtI" type="video/mp4" />
            </video>
            </div>
        </div>

    )
}
